import React from 'react';
import {BrowserRouter as Switch,Route} from "react-router-dom";
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './components/Navbar.js'
import Default from './components/Default.js'
import Details from './components/Details.js'
import ProductList from './components/ProductList.js'
import Cart from './components/Cart.js'
import Indexx from './pro/Indexx';
import Menu from './pro/Menu';
import Userlist from './pro/Userlist';
import Dashboard from './pro/Dashboard';
import Req from './pro/Req';
class App extends React.Component{
    state={
        userlists:[],
         source_url:''
    }
    componentDidMount(){
     this.getresultss();
    }
    onch4=(event)=>{
        this.setState({
            source_url:event.target.value
        })
    }
    getresults = _ =>{
    fetch('http://localhost:5000/userlist')
   .then(response => response.json())
   .then(response => this.setState({userlists:response.data}))
   .catch(err => console.error(err))
    }
    getresultss = _ =>{
        const { source_url }=this.state;
        fetch(`http://localhost:5000/userlist?source=${source_url}`)
       .then(response => response.json())
       .then(response => this.setState({userlists:response.data}))
       .catch(err => console.error(err))
        }

    render_user=({ ex_id,name })=><div key={ex_id}>{name}></div>
    render(){
        const { userlists }=this.state;
    return (
    <div>
    {userlists.map(this.render_user)}
        <label><b>Source</b></label>
        <input type="text" name="source_url" placeholder="enter url" onChange={this.onch2} required/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <button onClick={this.getresultss}> View</button>
    </div>
    );
  }
}
export default App;
